        public init(name: MetricName? = nil, statistic: MetricStatistic? = nil, value: Double? = nil) {
            self.name = name
            self.statistic = statistic
            self.value = value
        }

        private enum CodingKeys: String, CodingKey {
            case name
            case statistic
            case value
        }
    }

